import React from "react";
import '../../css/project.css'



function Project(props) {
    return (
        <section className="project">
            {props.prevProjects.map(item => {
                if(item.hasApp === true)
                {
                    return(
                    <div key={item.id}>
                        <h3>{item.name} if({item.schoolProj}){'for school'} </h3>
                        <img src={item.photoLink} width="400px"/>
                        <section>
                            <a href= {item.gitHub}>
                                <img alt="GitHub Repo Link" src= "https://cdn-icons-png.flaticon.com/512/25/25231.png" width="32px" height="32px"/>
                            </a>
                            
                            <a href= {item.appLink}>
                                <img alt="Application Link" src= "data:image/png;base64," width="32px" height="32px"/>
                            </a>
                        </section>
                        <p>{item.description}</p>
                    </div>
                    )
                }else{
                }
            })}
        </section>
    )
}

export default Project;
